script: |
  super -f text -I q5387.spq | sort > q5387.out

inputs:
  - name: q5387.spq
    data: |
      SELECT col1 AS col1 FROM tab0 (FORMAT parquet) AS cor0 WHERE NOT - 44 / col2 / - col2 * - - col0 + - 29 * + 49 BETWEEN col0 * col0 AND ( + col1 * 33 - - + CAST ( col0 AS INTEGER ) * col1 + + CAST ( NULL AS INTEGER ) * + col0 + col2 / - 49 + col1 - + + col2 );
  - name: tab0

outputs:
  - name: q5387.out
    data: |
      1
      21
      81
